import React, { Fragment, useState,useEffect } from "react";
import { Link } from "react-router-dom";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import { logout } from "../../actions/auth";
import Logo from "../../images/logo.png";
import Button from "react-bootstrap/Button";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import Modal from "react-bootstrap/Modal";
import axios from "axios";

const NavbaR = ({ auth: { isAuthenticated, loading }, logout }) => {
  // Setstate For Modal
  const [show, setShow] = useState(false);
  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);


  

  const authLinks = (
    <ul className="nav-links list-unstyled">
      <li className="d-inline">
        <Link to="/admin/dashboard">
          <i className="fas fa-user"></i>{" "}
          <span className="hide-sm">Dashboard</span>
        </Link>
      </li>
      &nbsp; &nbsp;&nbsp;
      <li className="d-inline">
        <Link onClick={logout} to="/" replace>
          <i className="fa fa-arrow-right"></i>{" "}
          <span className="hide-sm">Logout</span>
        </Link>
      </li>
    </ul>
  );
  const guestLinks = (
    <>
      <div className="container">
        <div className="row">
          <div className="col-md-3">
            <a href="/">Logo</a>
          </div>
          <div className="col-md-9 d-flex justify-content-center">
            <ul className="list-unstyled">
              <li className="list-inline-item text-light"><a href="/" className="text-decoration-none">Home</a></li>
              <li className="list-inline-item text-light"><a href="/" className="text-decoration-none">Pages</a></li>
              <li className="list-inline-item text-light"><a href="/" className="text-decoration-none">Products</a></li>
              <li className="list-inline-item text-light"><a href="/" className="text-decoration-none">Categories</a></li>
              <li className="list-inline-item text-light"><a href="/" className="text-decoration-none">Connect Now</a></li>
            </ul>
          </div>
        </div>
      </div>
    </>
  );

  return (
    <nav className="navbar bg-dark" style={{}}>
      {!loading && (
        <Fragment>{isAuthenticated ? authLinks : guestLinks}</Fragment>
      )}
    </nav>
  );
};

Navbar.propTypes = {
  logout: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
};

const mapStateToProps = (state) => ({
  auth: state.auth,
});

export default connect(mapStateToProps, { logout })(NavbaR);
